    getUnitAssessmentReadinessDetails(): Promise<DtUnitAssessmentReadinessDetails[]> {
        return Promise.resolve
        (this.getData());
    }

    getDataByTag(Level: number, TagId: string, TagConfigId: string) {
        let uard: any[] = this.getData().filter(unitReadiness => unitReadiness.TagID==TagId && unitReadiness.Level==Level && unitReadiness.TagConfigId==TagConfigId);

        return uard;
    }

    getDataByTagName(Level: number, TagName: string, TagConfigId: string) {
        let uard: any[] = this.getData().filter(unitReadiness => unitReadiness.TagName==TagName && unitReadiness.Level==Level && unitReadiness.TagConfigId==TagConfigId);

        return uard;
    }

    getDataByTagConfig(Level: number, TagConfigId: string): DtUnitAssessmentReadinessDetails[] {
        let uard: DtUnitAssessmentReadinessDetails[] = this.getData().filter(unitReadiness => unitReadiness.Level==Level && unitReadiness.TagConfigId==TagConfigId);

        return uard;
    }

    getChartMetlSummary(Level: number, TagConfigId: string): Array<UnitAssessmentReadinessSummaryMetl> {
        let uard: Array<DtUnitAssessmentReadinessDetails> = this.getDataByTagConfig(Level, TagConfigId);
        let tags: Array<Tag> = this.getUniqueTags(uard);

        let uardsArray: Array<UnitAssessmentReadinessSummaryMetl> = new Array<UnitAssessmentReadinessSummaryMetl>();

        for (let tag of tags) {
            let uardRows: Array<DtUnitAssessmentReadinessDetails> = uard.filter(unitReadiness => unitReadiness.TagID = tag.tagId);
            let uards: UnitAssessmentReadinessSummaryMetl = new UnitAssessmentReadinessSummaryMetl();

            uards.tagId = tag.tagId;
            uards.tagName = tag.tagName;
            uards.tagConfigId = TagConfigId;

            let yCountTotal: number = 0;
            let qCountTotal: number = 0;
            let nCountTotal: number = 0;
            let nrCountTotal: number = 0;
            let c12CountTotal: number = 0;
            let c3CountTotal: number = 0;
            let c4CountTotal: number = 0;
            let c5CountTotal: number = 0;
            let c6CountTotal: number = 0;

            for (let uardRow of uardRows) {
                yCountTotal = yCountTotal + uardRow.YCount;
                qCountTotal = qCountTotal + uardRow.QCount;
                nCountTotal = nCountTotal + uardRow.NCount;
                nrCountTotal = nrCountTotal + uardRow.NRCount;
                c12CountTotal = c12CountTotal + uardRow.C12Count;
                c3CountTotal = c3CountTotal + uardRow.C3Count;
                c4CountTotal = c4CountTotal + uardRow.C4Count;
                c5CountTotal = c5CountTotal + uardRow.C5Count;
                c6CountTotal = c6CountTotal + uardRow.C6Count;
            }

            uards.yCount = yCountTotal;
            uards.qCount = qCountTotal;
            uards.nCount = nCountTotal;
            uards.nrCount = nrCountTotal;
            uards.c12Count = c12CountTotal;
            uards.c3Count = c3CountTotal;
            uards.c4Count = c4CountTotal;
            uards.c5Count = c5CountTotal;
            uards.c6Count = c6CountTotal;

            uardsArray.push(uards);
        }

        return uardsArray;
    }

    getUniqueTags(uard: Array<DtUnitAssessmentReadinessDetails>): Array<Tag> {
        let tags: Array<Tag> = new Array<Tag>();

        // for each readiness row
        for (let uardRow of uard) {
            let foundTag: boolean = false;
            //Determine if the tag has already been added to the unique list of tags.
            for (let tag of tags) {
                if (tag.tagName == uardRow.TagName) {
                    foundTag = true;
                    break;
                }
            }

            //If the tag is not part of the unique list, add it.
            if (foundTag == false) {
                let tag: Tag = new Tag();

                tag.tagId = uardRow.TagID;
                tag.tagName = uardRow.TagName;

                tags.push(tag);
            }
        }

        return tags;
    }
